import React from "react";
import pizza from "../assets/images/images.jpg";
import "bootstrap/dist/css/bootstrap.min.css";
const Category = () => {
  return (
    <>
      <div className="category-card">
        <div className="category-image">
          <img src={pizza} />
        </div>
        <div>
          <h2>Pizza</h2>
        </div>
      </div>
      ;
    </>
  );
};

export default Category;
